import React from "react";
import { Route } from "react-router-dom";
import Type from "./Type";
import ExperienceListHome from "./ExperienceListHome";

const HomePage = function() {
    return (
        <div className="home-ctn">
            <Type />
            <ExperienceListHome />
        </div>
    )
}

function Home() {

    return (
        <div>
            <Route 
                exact path="/" 
                render={props => <ExperienceCard {...props} ex={el} />}
            />
            <Route path="/" exact component={HomePage} />
            <Route path="/adventures" exact component={HomePage} />
            <Route path="/food-tours" exact component={HomePage} />
            <Route path="/cooking" exact component={HomePage} />
            <Route path="/surfing" exact component={HomePage} />
            <Route path="/concerts" exact component={HomePage} />
            <Route path="/social-impact" exact component={HomePage} />
        </div>
    );

}

export default Home;
